# Загальна (спрощена) формула

`$$F(Y) = B_0 + B_1 X_1 + \dots + B_N X_N + \varepsilon$$`

* `\(F\)` - функція зв'язку (link function)

* `\(Y\)` - залежна змінна

* `\(B_0\)` - вільний параметр моделі (intercept)

* `\(B_1 \dots B_N\)` - коефіцієнти нахилу (slope)

* `\(X_1 \dots X_N\)` - незалежні змінні (предиктори)

* `\(\varepsilon\)` - похибки (залишки моделі)

---

# Функція зв'язку (link function)

## Перетворює розподіл залежної змінної так, щоб:
* Вона примала значення від `\(-\infty\)` до `\(\infty\)`
* Зв'язок залежної змінної з предикторами була лінійною.

## Приклади функцій зв'зяку:

* Identity – без перетворення («функція зв'язку» звичайної лінійної регресії).
* Логарифмування – дані не повинні бути негативними або нульовими, компенсує
правосторонню асиметрію.
* Зворотня функція (1/x) – дані можуть бути негативними, але не можуть бути
нульовими, змінює асиметрію. на протилежну.
* Квадратний корінь – тільки позитивні дані, компенсує правосторонню
асиметрію.
* Інші.

## ОСОБЛИВОСТІ:

# Регресія пуассона (poisson)

**Ім'я розподілу:** Пуассонівський

**Значення залеж. змінної:** `\((0;\infty)\)`

**Параметри:** `\(\lambda\)` - темп (rate).

**Типова функція зв'язку:** логарифм. 
&lt;br&gt;
&lt;br&gt;
&lt;img src="06_files/figure-html/unnamed-chunk-34-1.png" width="936" style="display: block; margin: auto;" /&gt;

---

# Проблеми з дисперсією

## На середнє і дисперсія у розподілу Пуассона один параметр `\(\lambda\)`

* Якщо дисперсія в реальності менше середнього - недодисперсія (underdispersion, зустрічається рідко).

* Якщо дисперсія в реальності більше середнього - наддисперсія (overdispersion, зустрічається дуже часто).

&gt; **В обох випадках наша модель неадекватна даним!**

# Негативно-біноміальна регресія
## (Negative Binomial)
.pull-left[
**Ім'я розподілу:** Негативне біноміальне.

**Значення залеж. змінної:** `\((0;\infty)\)`

**Параметри:** `\(\mu\)` - середнє; `\(\theta /a\)` - форма/дисперсія

**Типова функція зв'язку:** логарифм.

# Проблеми з нулями
## В такому випадку передбачають, що діють два процеси:
* Основний (Пуасонівський або негативно-біноміальний)

* Додатковий (який генерує додаткові нулі)

# Регресія з підвищеною кількістю нулів
## (Zero-Inflated)
.pull-left[
**Ім'я розподілу:** Пуассонівське/негативно-біноміальне з підвищенною кількістю нулів.

**Значення залеж. змінної:** `\((0;\infty)\)`

**Параметри:** так само, як в попередній + `\(\pi\)` (ймовірність належності процесу)

**Типова функція зв'язку:** логарифм.

# Приклад: рахунки
## Модель Пуассона
### Проблема з дисперсією

`$$\hat\phi = \frac{\chi^2}{n-p} = \frac{\sum(y_i-\hat\mu_i)^2/\hat\mu_i}{n-p}$$`

```r
sum(residuals(pois_fit, type ="pearson")^2)/pois_fit$df.residual
```

```
## [1] 5.24994
```

Для моделі Пуассона це значення має бути близьким до 1.

&gt; Потрібнен інший розподілю

# Відтік кліентів
## Клієнти часто покидають компанії - або повністю перестають користуватися сервісом, або віписуються від конкретного сервісу.
&lt;br&gt;
**Чи підходить логістична регресія для таких задач? Таехнічно - так, але...**

1. У нас є не тільки події, але й час до них:
2. Ми не можемо визначити час до події у тих, в кого воно ще не відбулось.
3. Виключити їх з моделі ми теж не можемо.
&lt;br&gt;&lt;br&gt;
&lt;center&gt;Що робити?&lt;/center&gt;

# Модель прискорення часу навдач
## (Accelerated Failure Time model, AFT)

.pull-left[
**Ім'я розподілу:** Вейбула (як варіант)

**Значення залеж. змінної:** `\((0;\infty)\)`

**Параметри:** `\(\alpha\)` - дисперсія; `\(\gamma\)` - форма

# Резюме
* Змінна з двома категоріями - біноміальна регресія

* Більше категорій - мутиноміальна.

* В категоріях є впорядкованість - порядкова

* Рахуємо кількість чогось – Пуассонівська. Дисперсія більше середнього – негативно-біноміальна. Занадто багато нулів – zero-inflated-модель.

* У нас є якась подія та час до неї – аналіз виживання.
